import React from "react";

function Expenses({ ExpenseItem, title, amount, date }) {
  return (
    <div className="expenses">
      <ExpenseItem title={title} amount={amount} date={date} />
      <ExpenseItem title={title} amount={amount} date={date} />
      <ExpenseItem title={title} amount={amount} date={date} />
      <ExpenseItem title={title} amount={amount} date={date} />
    </div>
  );
}

export default Expenses;
